import React from 'react';
import './AddItemButton.css';

export default function AddItemButton() {
	return (
		<div>
			<input
					type="text"
					class="form-control"
					placeholder="Username"
					aria-label="Username"
					aria-describedby="basic-addon1"
				/>
		</div>
	);
}
